{'identificationModule': {'nctId': 'NCT07065786', 'orgStudyIdInfo': {'id': 'GenTI-uHCC'}, 'organization': {'fullName': 'Zhongda Hospital', 'class': 'OTHER'}, 'briefTitle': 'A Generative Model-based System for Predicting Survival and Guiding Treatment Decisions in Patients With Unresectable Hepatocellularcarcinoma Undergoing Transcatheter Arterial Chemoembolization in Combination With Immunotherapy and Targeted Therapy', 'officialTitle': 'A Generative Model-based System for Predicting Survival and Guiding Treatment Decisions in Patients With Unresectable Hepatocellular Carcinoma Undergoing Transarterial Chemoembolization in Combination With Immunotherapy and Targeted Therapy'}, 'statusModule': {'statusVerifiedDate': '2025-07', 'overallStatus': 'ACTIVE_NOT_RECRUITING', 'expandedAccessInfo': {'hasExpandedAccess': False}, 'startDateStruct': {'date': '2024-01-01', 'type': 'ACTUAL'}, 'primaryCompletionDateStruct': {'date': '2026-01-01', 'type': 'ESTIMATED'}, 'completionDateStruct': {'date': '2026-02-01', 'type': 'ESTIMATED'}, 'studyFirstSubmitDate': '2025-07-01', 'studyFirstSubmitQcDate': '2025-07-10', 'studyFirstPostDateStruct': {'date': '2025-07-15', 'type': 'ACTUAL'}, 'lastUpdateSubmitDate': '2025-07-10', 'lastUpdatePostDateStruct': {'date': '2025-07-15', 'type': 'ACTUAL'}}, 'sponsorCollaboratorsModule': {'responsibleParty': {'type': 'PRINCIPAL_INVESTIGATOR', 'investigatorFullName': 'Gao-jun Teng', 'investigatorTitle': 'Professor of Radiology Zhongda Hospital, Southeast University', 'investigatorAffiliation': 'Zhongda Hospital'}, 'leadSponsor': {'name': 'Zhongda Hospital', 'class': 'OTHER'}}, 'oversightModule': {'isFdaRegulatedDrug': False, 'isFdaRegulatedDevice': False}, 'descriptionModule': {'briefSummary': 'The entry point of this study is the proposition of "generative longitudinal prediction," which utilizes only pre-treatment imaging to create high-fidelity predictions of post-treatment imaging. This approach effectively overcomes the clinical challenge of acquiring genuine longitudinal follow-up data. This paradigm shift not only tackles the scarcity of longitudinal data but also introduces an innovative method for treatment simulation using digital twins. Clinicians can intuitively assess the potential efficacy of various treatment plans before intervention through virtually generated multi-timepoint imaging, providing a visual foundation for personalized treatment decisions. This research merges generative AI with dynamic risk models to achieve: 1) a transition from static assessment to dynamic simulation; 2) earlier survival predictions; and 3) personalized optimization of treatment plans. By eliminating dependence on longitudinal data, we aim to deliver more precise and individualized treatment decision support for advanced liver cancer patients, ultimately enhancing survival outcomes and quality of life.', 'detailedDescription': 'The entry point of this study is the proposition of "generative longitudinal prediction," which utilizes only pre-treatment imaging to create high-fidelity predictions of post-treatment imaging. This approach effectively overcomes the clinical challenge of acquiring genuine longitudinal follow-up data. This paradigm shift not only tackles the scarcity of longitudinal data but also introduces an innovative method for treatment simulation using digital twins. Clinicians can intuitively assess the potential efficacy of various treatment plans before intervention through virtually generated multi-timepoint imaging, providing a visual foundation for personalized treatment decisions. This research merges generative AI with dynamic risk models to achieve: 1) a transition from static assessment to dynamic simulation; 2) earlier survival predictions; and 3) personalized optimization of treatment plans. By eliminating dependence on longitudinal data, we aim to deliver more precise and individualized treatment decision support for advanced liver cancer patients, ultimately enhancing survival outcomes and quality of life. The model was developed in a retrospective cohort, with validation and testing conducted in multiple retrospective and prospective cohorts, respectively.'}, 'conditionsModule': {'conditions': ['Transcatheter Arterial Chemoembolization', 'Unresectable Hepatocellular Carcinoma'], 'keywords': ['hepatocellular carcinoma', 'gengerative model', 'transcatheter arterial chemoembolization', 'immunotherapy']}, 'designModule': {'studyType': 'OBSERVATIONAL', 'patientRegistry': True, 'targetDuration': '18 Months', 'designInfo': {'observationalModel': 'COHORT', 'timePerspective': 'OTHER'}, 'enrollmentInfo': {'count': 550, 'type': 'ESTIMATED'}}, 'armsInterventionsModule': {'armGroups': [{'label': 'development cohort, validation cohort, test cohort', 'interventionNames': ['Other: Generative model']}], 'interventions': [{'type': 'OTHER', 'name': 'Generative model', 'description': 'Prospectively enroll pretreatment imaging data from patients with unresectable hepatocellular carcinoma undergoing TACE in combination with immunotherapy plus targeted therapy. Utilize a generative model to create virtual images that represent optimal treatment responses, and compare these virtual images with actual treatment response images collected during follow-up to evaluate the reliability of the generative model.', 'armGroupLabels': ['development cohort, validation cohort, test cohort']}]}, 'outcomesModule': {'primaryOutcomes': [{'measure': 'Overall survival', 'description': 'defined as the time from the initial of combined therapy to death from any cause', 'timeFrame': 'Through study completion, an average of 20 months'}]}, 'eligibilityModule': {'eligibilityCriteria': 'Inclusion Criteria:

* Diagnosed as unresectable hepatocellular carcinoma (HCC) by histopathology and/or clinical diagnosis (typical imaging features, clinical manifestations, laboratory tests, etc.) (Reference: Guidelines for Diagnosis and Treatment of Primary Liver Cancer (2024 Edition));
* Patients with unresectable HCC receiving TACE combined with targeted immunotherapy;
* Liver function classified as Child-Pugh A or B;
* Aged 18 or above, regardless of gender;
* Expected survival time 3 months;
* ECOG PS score 2;
* Meeting the following laboratory parameters: a) Hematologic function: Absolute neutrophil count 1.010/L; Platelet count 5010/L; Hemoglobin 90 g/L; International normalized ratio (INR) \<1.7 or prothrombin time prolongation 4 seconds; b) Liver function: ALT/AST 5 upper limit of normal (ULN); Total bilirubin 210 mol/L \[2.38 mg/dL\]; Albumin 28 g/L; c) Renal function: Serum creatinine 1.5 ULN.

Exclusion Criteria:

* Concurrent presence of other malignant tumors besides HCC;
* Moderate to severe ascites (ascites scoring 3 points on the Child-Pugh scale); - - Receipt of other first-line, second-line, or third-line systemic therapies (including any regimen of systemic treatment) or any local therapies (including transcatheter interventional therapy, ablation therapy, internal/external radiotherapy, etc.), as well as surgical resection or herbal medicine within 4 weeks prior to TACE combined with targeted immunotherapy;
* Incomplete data, such as missing baseline laboratory test results, unavailable or poor-quality imaging data, or lack of prognostic information;
* Severe liver dysfunction: e.g., decompensated cirrhosis or other liver diseases significantly affecting bilirubin levels;
* Severe comorbidities: e.g., refractory hypertension (blood pressure remaining above 150/100 mm Hg despite optimal medication), persistent arrhythmia (CTCAE grade 2 or higher), atrial fibrillation of any degree, prolonged QTc interval (\>450 ms in males or \>470 ms in females), renal insufficiency, etc.;
* Co-infection with human immunodeficiency virus (HIV) or acquired immunodeficiency syndrome (AIDS);
* Pregnant or breastfeeding women;
* Acute or chronic psychiatric disorders (including those affecting participant enrollment, treatment intervention, or follow-up).', 'healthyVolunteers': False, 'sex': 'ALL', 'minimumAge': '18 Years', 'stdAges': ['ADULT', 'OLDER_ADULT'], 'studyPopulation': 'Unresectable hepatocellular carcinoma undergoing TACE in combination with immunotherapy plus targeted therapy', 'samplingMethod': 'NON_PROBABILITY_SAMPLE'}, 'contactsLocationsModule': {'locations': [{'facility': 'Zhongda hospital', 'city': 'Changzhou', 'state': 'Jiangsu', 'zip': '213003', 'country': 'China', 'geoPoint': {'lat': 31.77359, 'lon': 119.95401}}]}, 'ipdSharingStatementModule': {'ipdSharing': 'NO'}}

{'identificationModule': {'nctId': 'NCT03751566', 'orgStudyIdInfo': {'id': 'MOU-001'}, 'organization': {'fullName': 'Masaryk Memorial Cancer Institute', 'class': 'OTHER'}, 'briefTitle': 'Acupuncture as the Therapeutic Modalities of Acute Toxicity in the Radiotherapy of Head and Neck Tumors', 'officialTitle': 'Acupuncture as the Therapeutic Modalities of Acute Toxicity in the Radiotherapy of Head and Neck Tumors'}, 'statusModule': {'statusVerifiedDate': '2025-09', 'overallStatus': 'RECRUITING', 'expandedAccessInfo': {'hasExpandedAccess': False}, 'startDateStruct': {'date': '2021-10-05', 'type': 'ACTUAL'}, 'primaryCompletionDateStruct': {'date': '2023-09-04', 'type': 'ACTUAL'}, 'completionDateStruct': {'date': '2026-10-04', 'type': 'ESTIMATED'}, 'studyFirstSubmitDate': '2018-11-15', 'studyFirstSubmitQcDate': '2018-11-21', 'studyFirstPostDateStruct': {'date': '2018-11-23', 'type': 'ACTUAL'}, 'lastUpdateSubmitDate': '2025-09-23', 'lastUpdatePostDateStruct': {'date': '2025-09-25', 'type': 'ESTIMATED'}}, 'sponsorCollaboratorsModule': {'responsibleParty': {'type': 'SPONSOR'}, 'leadSponsor': {'name': 'Masaryk Memorial Cancer Institute', 'class': 'OTHER'}}, 'oversightModule': {'oversightHasDmc': False, 'isFdaRegulatedDrug': False, 'isFdaRegulatedDevice': False, 'isUsExport': False}, 'descriptionModule': {'briefSummary': 'The aim of the study is to evaluate the benefit of the acupuncture as healing modalities in the therapy of acute toxicity of radiotherapy.', 'detailedDescription': 'The study will enroll 100 patients in current radiotherapy of the head and neck cancer with acute radiotoxic symptoms at least of G1. The patients will be randomized (by ticket) in two regimens 1:1.

Regimen A (control regimen): standard support treatment of adverse events of the radiotherapy.

Regimen B (acupuncture regimen): standard support treatment of adverse events of the radiotherapy and acupuncture.

Due to the disease and patients differences, treatment will be individualized. Used acupuncture points will be documented. The patients difficulties will be observed and their medication and will be recorded in the patient diary.

Possible skin toxicities wil be documented by the photography.

Before the randomization, all subjects will sign the voluntary informed consent. After the achievement of 50 enrolled subjects in any regimen, the enrollment will continue only to the other regimen.

Head and neck cancer therapy will include only curative and adjuvant radiotherapy.'}, 'conditionsModule': {'conditions': ['Malignant Tumor of Soft Tissue of Head, Face and Neck']}, 'designModule': {'studyType': 'INTERVENTIONAL', 'phases': ['NA'], 'designInfo': {'allocation': 'RANDOMIZED', 'interventionModel': 'PARALLEL', 'primaryPurpose': 'TREATMENT', 'maskingInfo': {'masking': 'NONE'}}, 'enrollmentInfo': {'count': 60, 'type': 'ESTIMATED'}}, 'armsInterventionsModule': {'armGroups': [{'label': 'Regimen A', 'type': 'ACTIVE_COMPARATOR', 'description': 'Regimen A (control regimen): standard support treatment of adverse events of the radiotherapy.', 'interventionNames': ['Drug: Standard supportive therapy']}, {'label': 'Regimen B', 'type': 'EXPERIMENTAL', 'description': 'Regimen B (acupuncture regimen): standard support treatment of adverse events of the radiotherapy and acupuncture.', 'interventionNames': ['Other: Acupuncture', 'Drug: Standard supportive therapy']}], 'interventions': [{'type': 'OTHER', 'name': 'Acupuncture', 'description': 'Schedule of the acupuncture:

Acupuncture may be done ambulant or during hospitalisation . Acupuncture will be administered 1-3 times a week ( in case of severe toxicity and problems caused by the radiotherapy, it may continue also after the termination of the radiotherapy.) Acupuncture needles will be left for 5- 30 minutes, as per individual need of the patients.

Acupuncture will be performed by a physician trained in acupuncture.', 'armGroupLabels': ['Regimen B']}, {'type': 'DRUG', 'name': 'Standard supportive therapy', 'description': 'Standard supportive therapy', 'armGroupLabels': ['Regimen A', 'Regimen B']}]}, 'outcomesModule': {'primaryOutcomes': [{'measure': 'Management of acute toxicity of radiotherapy with acupuncture: Reducing the grade of acute toxicity in radiotherapy', 'description': 'Reducing the grade of acute toxicity in radiotherapy.', 'timeFrame': 'six months after the end of radiotherapy'}], 'secondaryOutcomes': [{'measure': 'Management of chronic toxicity of radiotherapy with acupuncture: Lower incidence of chronic toxicity of radiotherapy', 'description': 'Lower incidence of chronic toxicity of radiotherapy.', 'timeFrame': 'six months after the end of radiotherapy'}]}, 'eligibilityModule': {'eligibilityCriteria': 'Inclusion Criteria:

* Curative and adjuvant radiotherapy for head and neck tumors;
* PS 1-2;
* Patient collaboration in evaluation of the toxicity diary.

Exclusion Criteria:

* Palliative radiotherapy in the head and neck tumor;
* PS 3;
* Non-compliance of the patient.', 'healthyVolunteers': False, 'sex': 'ALL', 'minimumAge': '18 Years', 'stdAges': ['ADULT', 'OLDER_ADULT']}, 'contactsLocationsModule': {'centralContacts': [{'name': 'Renata Hejnov, Msc', 'role': 'CONTACT', 'phone': '+42054313', 'phoneExt': '6232', 'email': 'renata.hejnova@mou.cz'}, {'name': 'Regina Demlov, MD,Ph.D.', 'role': 'CONTACT', 'email': 'demlova@mou.cz'}], 'locations': [{'facility': 'Masaryk Memorial Cancer Institute', 'status': 'RECRUITING', 'city': 'Brno', 'zip': '65653', 'country': 'Czechia', 'contacts': [{'name': 'Radana Dymkov, MD', 'role': 'CONTACT', 'phone': '+42054313', 'phoneExt': '1130', 'email': 'radana.dymackova@mou.cz'}], 'geoPoint': {'lat': 49.19522, 'lon': 16.60796}}]}, 'referencesModule': {'references': [{'pmid': '22072272', 'type': 'BACKGROUND', 'citation': 'Meng Z, Garcia MK, Hu C, Chiang J, Chambers M, Rosenthal DI, Peng H, Zhang Y, Zhao Q, Zhao G, Liu L, Spelman A, Palmer JL, Wei Q, Cohen L. Randomized controlled trial of acupuncture for prevention of radiation-induced xerostomia among patients with nasopharyngeal carcinoma. Cancer. 2012 Jul 1;118(13):3337-44. doi: 10.1002/cncr.26550. Epub 2011 Nov 9.'}, {'pmid': '21537645', 'type': 'BACKGROUND', 'citation': 'Braga FP, Lemos Junior CA, Alves FA, Migliari DA. Acupuncture for the prevention of radiation-induced xerostomia in patients with head and neck cancer. Braz Oral Res. 2011 Mar-Apr;25(2):180-5. doi: 10.1590/s1806-83242011000200014.'}, {'pmid': '32597419', 'type': 'DERIVED', 'citation': 'Dymackova R, Kazda T, Slavik M, Selingerova I, Slampa P, Slama O. Acupuncture in the treatment of acute toxicity during and after head and neck cancer radiotherapy: Interim analysis of randomized prospective open-label trial. Biomed Pap Med Fac Univ Palacky Olomouc Czech Repub. 2020 Dec;164(4):454-460. doi: 10.5507/bp.2020.021. Epub 2020 Jun 18.'}]}, 'ipdSharingStatementModule': {'ipdSharing': 'NO'}}
